import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import style from './Home.module.scss';
import Button from 'react-bootstrap/Button';
import Switch from 'react-bootstrap/Form';
import { useState } from 'react';


const Home = () => {
    const [checked, setChecked] = useState(false);


    return (
    <>
        <div id={style.star1}></div>
        <div id={style.star2}></div>
        <div id={style.star3}></div>
        <div id={style.star4}></div>
        <div id={style.sun}></div>
        {/* <div id={style.mercury}></div> */}

        <Form>
      {['checkbox', 'radio'].map((type) => (
        <div key={`inline-${type}`} className="mb-3">
          <Form.Check
            inline
            label="1"
            name="group1"
            type={type}
            id={`inline-${type}-1`}
          />
          <Form.Check
            inline
            label="2"
            name="group1"
            type={type}
            id={`inline-${type}-2`}
          />
          <Form.Check
            inline
            disabled
            label="3 (disabled)"
            type={type}
            id={`inline-${type}-3`}
          />
        </div>
      ))}
    </Form>

    </>

    );
};

export default Home;
